import React from 'react'

function Navbar() {
    return (
        <div className="navbar">
            <ul className="navbar-list">
                <li className="classes-link"></li>
                <li><a className="music-link">Music</a></li>
                <li><a className="private-link">Book Private</a></li>
            </ul>
        </div>
    )
}

export default Navbar
